// Function to perform the process injection
BOOL InjectProcess(DWORD processId, const std::wstring& dllPath)
{
    // Open the process
    HANDLE processHandle = OpenProcess(PROCESS_ALL_ACCESS, FALSE, processId);
    if (processHandle == NULL)
    {
        return FALSE;
    }

    // Allocate memory in the process for the DLL path
    LPVOID dllPathAddress = VirtualAllocEx(processHandle, NULL, dllPath.length() * 2, MEM_COMMIT, PAGE_READWRITE);
    if (dllPathAddress == NULL)
    {
        CloseHandle(processHandle);
        return FALSE;
    }

    // Write the DLL path to the allocated memory
    SIZE_T bytesWritten;
    if (!WriteProcessMemory(processHandle, dllPathAddress, dllPath.c_str(), dllPath.length() * 2, &bytesWritten))
    {
        VirtualFreeEx(processHandle, dllPathAddress, dllPath.length() * 2, MEM_RELEASE);
        CloseHandle(processHandle);
        return FALSE;
    }

    // Get the address of the LoadLibrary function
    LPVOID loadLibraryAddress = GetProcAddress(GetModuleHandle(L"kernel32.dll"), "LoadLibraryW");
    if (loadLibraryAddress == NULL)
    {
        VirtualFreeEx(processHandle, dllPathAddress, dllPath.length() * 2, MEM_RELEASE);
        CloseHandle(processHandle);
        return FALSE;
    }

    // Create a remote thread in the process to execute the LoadLibrary function
    HANDLE remoteThread = CreateRemoteThread(processHandle, NULL, 0, (LPTHREAD_START_ROUTINE)loadLibraryAddress, dllPathAddress, 0, NULL);
    if (remoteThread == NULL)
    {
        VirtualFreeEx(processHandle, dllPathAddress, dllPath.length() * 2, MEM_RELEASE);
        CloseHandle(processHandle);
        return FALSE;
    }

    // Wait for the thread to finish
    WaitForSingleObject(remoteThread, INFINITE);

    // Cleanup
    VirtualFreeEx(processHandle, dllPathAddress, dllPath.length() * 2, MEM_RELEASE);
    CloseHandle(remoteThread);
    CloseHandle(processHandle);

    return TRUE;
}

